import align_image_mtcnn
import argparse
import base64
import facenet
import os
import shutil
import sys
import math
import pickle
from scipy import misc
from sklearn.svm import SVC

def classify(encoded_string, output_path, model_path, classifier_path, image_size=160, rand_seed=666):

    img_data = encoded_string.encode()

    decoded_filename = os.path.join(output_path, 'decoded_image.JPG')
    with open(decoded_filename, 'wb') as fh:
        fh.write(base64.decodebytes(img_data))

    aligned_path = align_image_mtcnn.align_face(decoded_filename, output_path)

    with tf.Graph().as_default():

        with tf.Session() as sess:

            np.random.seed(seed=rand_seed)

            # Load the model
            print('Loading feature extraction model')
            facenet.load_model(model_path)

            # Get input and output tensors
            images_placeholder = tf.get_default_graph().get_tensor_by_name("input:0")
            embeddings = tf.get_default_graph().get_tensor_by_name("embeddings:0")
            phase_train_placeholder = tf.get_default_graph().get_tensor_by_name("phase_train:0")
            embedding_size = embeddings.get_shape()[1]

            # Run forward pass to calculate embeddings
            print('Calculating features for images')
            image = load_image(aligned_path, False, False, image_size)
            feed_dict = { images_placeholder:[image], phase_train_placeholder:False }
            emb_array = sess.run(embeddings, feed_dict=feed_dict)


            classifier_filename_exp = os.path.expanduser(classifier_path)

            # Classify images
            print('Testing classifier')
            with open(classifier_filename_exp, 'rb') as infile:
                (model, class_names) = pickle.load(infile)

            print('Loaded classifier model from file "%s"' % classifier_filename_exp)

            predictions = model.predict_proba(emb_array)
            best_class_indices = np.argmax(predictions, axis=1)
            best_class_probabilities = predictions[np.arange(len(best_class_indices)), best_class_indices]

            for i in range(len(best_class_indices)):
                print('%4d  %s: %.3f' % (i, class_names[best_class_indices[i]], best_class_probabilities[i]))

            delete_decoded_files(output_path)

    return class_names[best_class_indices[0]], best_class_probabilities[0]


def load_image(image_path, do_random_crop, do_random_flip, image_size, do_prewhiten=True):
    image = misc.imread(image_path)
    if image.ndim == 2:
        image = to_rgb(image)
    if do_prewhiten:
        image = facenet.prewhiten(image)
    image = facenet.crop(image, do_random_crop, image_size)
    image = facenet.flip(image, do_random_flip)

    return image

def delete_decoded_files(folder):
    for filename in os.listdir(folder):
        file_path = os.path.join(folder, filename)
        try:
            if os.path.isfile(file_path) or os.path.islink(file_path):
                os.unlink(file_path)
            elif os.path.isdir(file_path):
                shutil.rmtree(file_path)
        except Exception as e:
            print('Failed to delete %s. Reason: %s' % (file_path, e))

def main():
    encoded_string = ''
    output_path = 'decoded'
    model_path = 'models/20180402-114759/20180402-114759.pb'
    classifier_path = 'models/my_classifier.pkl'

    prediction = classify(encoded_string, output_path, model_path, classifier_path)

if __name__ == '__main__':
    main()
